        .content:hover .front {
            transform: translateZ(200px);
        }

        .content:hover .back {
            transform: translateZ(-200px) rotateY(180deg);
        }

        .content:hover .left {
            left: -200px;
        }

        .content:hover .right {
            left: 200px;
        }

        .content:hover .top {
            top: -200px;
        }

        .content:hover .bottom {
            top: 200px;
        }

        .front {
            transform: translateZ(100px);
            background-color: rgba(36, 85, 75, 0.5);
        }

        .back {
            transform: translateZ(-100px) rotateY(180deg);
            background-color: rgba(36, 255, 1, 0.5);
        }

        .left {
            left: -100px;
            transform: rotateY(-90deg);
            background-color: rgba(25, 62, 75, 0.5);
        }

        .right {
            left: 100px;
            transform: rotateY(90deg);
            background-color: rgba(25, 62, 75, 0.5);
        }

        .top {
            top: -100px;
            transform: rotateX(90deg);
            background-color: rgba(255, 62, 26, 0.5);
        }

        .bottom {
            top: 100px;
            transform: rotateX(-90deg);
            background-color: rgba(255, 62, 26, 0.5);
        }

            0% {
                transform: rotateY(0);
            }

            25% {
                transform: rotateX(180deg) rotateZ(180deg);
            }

            50% {
                transform: rotateX(0) rotateZ(180deg);
            }

            75% {
                transform: rotateX(180deg) rotateZ(0);
            }

            100% {
                transform: rotateY(0);
            }
        }
    </style>
</head>

    <div class="container">
        <div class="box">
            <div class="content">
                <div class="front"></div>
                <div class="back"></div>
                <div class="left"></div>
                <div class="right"></div>
                <div class="top"></div>
                <div class="bottom"></div>
            </div>
        </div>
    </div>
</body>
